import React from "react"
import styled from "styled-components"
import FormLogin from "./FormLogin"
import Header from "./Header"

function Login() {
    return (
        <Container>
            <Wrap bgImage={props.backgroundImg}>
            <Header />
            <FormLogin />
            </Wrap>
        </Container>

    )
}

export default Login

const Container = styled.div`
    width: 100vw;    
    height: 100vh;
`
